import logo from './logo.svg';
import './App.css';
import Login from "./view/LogInPage";

class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            currentPage: 1,
        };
    }

    render() {
        return (
            <div className="App">
                {this.state.currentPage === 1 && (
                    <div>
                        <Login/>
                    </div>
                )}

                {this.state.currentPage === 2 && (
                    <div>

                    </div>
                )}
            </div>
        );
    }
}

export default App;
